import React from 'react';
import  { Link } from "react-router-dom"

const style = {
    flexWrap: "nowrap",
    flexDirection: "row",
    justifyContent: "space-between",
    width: "100%",
    marginBottom: "20px",
    alignItems: "center",
    borderRadius: "15px 0 15px 0"
}

const Nav = () => {
  return (
    <nav>
        <ul style={style}>
            <Link to='/'><li>Home</li></Link> 
            <Link to='/impressum'><li>Impressum</li></Link>
            <Link to='/help'><li>Help</li></Link>
        </ul>
    </nav>
  );
}

export default Nav;
